import Navbar from "./components/Navbar/Navbar";
import Home from "./pages/Home/Home";
import PostDetail from "./pages/single/postDetail";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Navbar/>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
